import React from 'react'
import { array } from 'prop-types'
import { Link } from 'react-router-dom'
// Styles
import './style.scss'

const Header = ({ navItems }) => {
  return (
    <header className="fixed-top wwc-header">
      <div className="wwheader ui container">
        <a href="/" className=" " alt="wwc-logo">
          Work With Coffee
        </a>
        <nav className="wwc-menu">
          {navItems.map(item => (
            <Link key={item.path} to={item.path} className="item">
              {item.text}
            </Link>
          ))}
        </nav>
      </div>
    </header>
  )
}

Header.propTypes = {
  navItems: array
}

Header.defaultProps = {
  navItems: []
}

export default Header
